import logo from "./logo.svg";
import "./App.css";
import { Button, Typography, Layout, Menu, Icon, Affix } from "antd";
import React, { Component } from "react";

import ProfilePic from "./raghu.jpg";
const { Title } = Typography;
const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;
const { Header, Content, Footer, Sider } = Layout;

class App extends Component {
  handleItemClick = (e, { name }) => this.setState({ activeItem: name });

  render() {
    return (
      <div>
        <div
          className="background-image App App-header"
          style={{ height: "100%" }}
        >
          <img
            src={ProfilePic}
            height="300px"
            style={{ borderRadius: "10%", boxShadow: "2px 2px 40px black" }}
          />
          <br />
          <Title style={{ color: "white" }}>Shri Raghu Raaman</Title>
          <Title level={4} style={{ color: "white" }}>
            Blockchain Trainer, Developer and Architect | Co-Founder & CEO at
            CelebratON | Web Developer | Hustler
          </Title>

          <Affix offsetTop="0">
            <Menu
              // onClick={this.handleClick}
              // selectedKeys={[this.state.current]}
              mode="horizontal"
            >
              <Menu.Item key="mail">
                <Icon type="mail" />
                Navigation One
              </Menu.Item>
              <Menu.Item key="app" disabled>
                <Icon type="appstore" />
                Navigation Two
              </Menu.Item>
              <SubMenu
                title={
                  <span className="submenu-title-wrapper">
                    <Icon type="setting" />
                    Navigation Three - Submenu
                  </span>
                }
              >
                <MenuItemGroup title="Item 1">
                  <Menu.Item key="setting:1">Option 1</Menu.Item>
                  <Menu.Item key="setting:2">Option 2</Menu.Item>
                </MenuItemGroup>
                <MenuItemGroup title="Item 2">
                  <Menu.Item key="setting:3">Option 3</Menu.Item>
                  <Menu.Item key="setting:4">Option 4</Menu.Item>
                </MenuItemGroup>
              </SubMenu>
              <Menu.Item key="alipay">
                <a
                  href="https://ant.design"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Navigation Four - Link
                </a>
              </Menu.Item>
            </Menu>
          </Affix>
        </div>
        <Title level={4} style={{ color: "black" }}>
          Blockchain Trainer, Developer and Architect | Co-Founder & CEO at
          CelebratON | Web Developer | Hustler
        </Title>
        <Footer>something</Footer>
      </div>
    );
  }
}

export default App;
